import react from "react";
import styled from "styled-components";
import { useNavigate } from "react-router-dom";
import { ToggleButtonGroup, ToggleButton } from "react-bootstrap";
import React from "react";
import Header from "./Header";
const SearchCheck = styled.div`
  width: 100%;
  height: 100px;
  display: flex;
  flex-direction: row;
  align-items: center;
  input {
    height: 40px;
    border-radius: 3px;
  }
  button {
    height: 40px;
    border-radius: 3px;
  }
  div {
    height: 40px;
  }
`;

function Home() {
  return (
    <div>
      <Header />
      <SearchCheck>
        <input placeholder="검색어" type="text" />
        <button>검색</button>
        <form>
          <input type="radio" name="chk_info" value="HTML">
            HTML
          </input>
          <input type="radio" name="chk_info" value="CSS">
            CSS
          </input>
          <input type="radio" name="chk_info" value="웹디자인">
            웹디자인
          </input>
        </form>
      </SearchCheck>
    </div>
  );
}

export default Home;
